const Home = () => {
  return (
    <React.Fragment>
      <h1>WELCOME!</h1>
      <h2>This is afree application for online meetings.</h2>
      <h3>
        You can <a href="/join-meeting">join a meeting</a>
      </h3>
    </React.Fragment>
  );
};

export default Home;
